<input type="text" name="Transmission" placeholder="КПП :"/>
<br/> <label>Объем двигателя: </label>
<input type="number" name="EngineCapaity" placeholder="Объем двигателя :"/>
<br/> <label>Привод: </label>
<input type="text" name="Drive" placeholder="Привод :"/>
<br/> <label>Тип двигателя: </label>
<input type="text" name="EngineType" placeholder="Тип двигателя :"/>
<br/> <label>Количество в наличии: </label>
<input type="number" name="InStock" placeholder="В наличии :"/>
<br/> <label>Модель: </label>
<input type="number" name="id_model" placeholder="В наличии :"/>
<br/> <label>Цвет: </label>
<input type="number" name="id_colour" placeholder="В наличии :"/>
<button type="submit">Создать</button> */}
          </Form>
        </>
      ) : ("")}
    </React.Fragment >
  )
}
export default ConstructionCreate
